import React from 'react'
import './AutoWizard.css';

import {
    Row
} from 'react-bootstrap';

export default function AutoWizard() {
    return (
        <Row style={{height: window.innerHeight}} className="d-flex">
            <div className="m-auto wizard-popup d-flex flex-column">
                <Row>
                    <Col lg={2} />

                    <Col>
                        <div className="m-auto wizard-popup-btn d-flex">
                            <p className="m-auto">Specific postâ€™s comment</p>
                        </div>
                    </Col>

                    <Col lg={2} />
                </Row>
                
                <div className="m-auto wizard-popup-btn">
                    Generic intents
                </div>
            </div>
        </Row>
    )
}
